from itertools import combinations
from math import sqrt
n=int(input())

k=int(sqrt(2*n))+1

if(k*(k-1)==2*n):
    res=[[0 for _ in range(k-1)] for _ in range(k)]
    num=[0 for _ in range(k)]
    for i,pair in enumerate(combinations(range(k),2)):
        for a in pair:
            res[a][num[a]]=i+1
            num[a]+=1

    print('Yes')
    print(k)
    for row in res:
        print(k-1,end=' ')
        for e in row:
            print(e,end=' ')
        print('')
else:
    print('No')

